import "./ExpenseItem.css";

function ExpenseDate(props) {
  const years = props.date.getFullYear();
  const months = props.date.toLocaleString("ko-KR", { month: "long" });
  const days = props.date.toLocaleString("ko-KR", { day: "2-digit" });

  return (
    <div>
      <div>{years}</div>
      <div>{months}</div>
      <div>{days}</div>
    </div>
  );
}

